import React from 'react';
const UserCard = (props) => {
  return (
    <div className={style.profile_name}>
      <div className={style.photo_profile}>
        <img className={style.photo} src={props.myPhoto} alt="group_photo" />
        <div className={style.username}>
          <div>{props.my_name}</div>
        </div>
      </div>
      <div>
        <div className={style.place}>{props.place_of_study}</div>
      </div>
      <div className={style.message}>
        <div className={style.write_message}>Write Message {props.writeMessage}</div>
        <div className={style.call}>Call {props.callMe}</div>
      </div>
    </div>
  );
};

export default UserCard;
